import axios from 'axios'

export const startGetUsers = () => 
{
    return((dispatch) => 
    {
        axios.get('https://jsonplaceholder.typicode.com/users')
        .then((response) => {
            const output = response.data
            console.log(output)
        })
        .catch((err) => 
        {
            alert(err.message)
        })
    })
}
